import React from 'react';
import Format from '../../components/format/format.component'
const SelectFormat = () =>{
    let formats = [
        ['QB','RB1','RB2','WR1','WR2','TE','K','Flex','DEF'],
        ['QB','RB1','RB2','WR1','WR2','WR3','TE','K','Flex','DEF'],
        ['QB','RB1','RB2','WR1','WR2','TE','K','Flex','Flex2','DEF'],
        ['QB1','QB2','RB1','RB2','WR1','WR2','TE','K','Flex','DEF']
    ]
    return(
        <div className='select-format'>
           { formats.foreach(format=><Format format={format}/>)}
        </div>
    )
}

export default SelectFormat
